import React from "react";

const Avatar = ({image,scale}) => {
    let height = 48*scale;
    let width = 48*scale;
    return (
        <div className={`h-[{height}px] w-[48px] rounded-full shadow-md`}>
            <img src = {image} className = "w-full h-full rounded-full object-cover" alt = "avatar"/>
        </div>
    );
}

export default Avatar;
